import React, { Children } from 'react'
import { createBrowserRouter } from 'react-router-dom'
import Layout from './Components/Layout/Layout';
import About from './Components/About/About';

const App=()=>{
  let routes=createBrowserRouter([
    {
      path:"",
      element:<Layout/>,
    children:[
      {
        path:"About",
        element:<About/>,
      },
      {
        path:"",
        element:<About/>,
      },
    ],
    },
  ]);
}

export default App
